import React from 'react';
import styled from 'styled-components';

const Box = styled.div`
  &.box1 {
    border: 10px solid black;
    margin: 10px auto;
    padding: 30px;
    text-align: center;
    width: auto;
  }
  &.box2 {
    border: 10px solid 
  }
`;
const StyleEx = () => {
  return (
    <div>StyleEx</div>
  );
};

export default StyleEx;
